type UseStrings = {
  convertBooleanAsAffirmativeString: (value: boolean) => string;
  lowerCaseFirstLetter: (value: string) => string;
};

function useStrings(): UseStrings {
  function convertBooleanAsAffirmativeString(value: boolean): "yes" | "no" {
    return value ? "yes" : "no";
  }

  function lowerCaseFirstLetter(value: string): string {
    return value.charAt(0).toLowerCase() + value.slice(1);
  }
  return {
    convertBooleanAsAffirmativeString,
    lowerCaseFirstLetter,
  };
}

export { useStrings };

app/composables/misc/useTimers.ts.source:
type UseTimers = {
  getSecondsInMinutesLabel: (seconds: number) => string;
};

function useTimers(): UseTimers {
  const secondsInOneMinute = 60;
  const { t } = useI18n();

  function getSecondsInMinutesLabel(seconds: number): string {
    const minutes = Math.floor(seconds / secondsInOneMinute);
    const remainingSeconds = seconds % secondsInOneMinute;
    const minutesLabel = t("shared.time.minute", { count: minutes }, minutes);
    const secondsLabel = t("shared.time.second", { count: remainingSeconds }, remainingSeconds);

    if (minutes === 0) {
      return secondsLabel;
    }
    if (remainingSeconds === 0) {
      return minutesLabel;
    }
    return `${minutesLabel} ${t("shared.and")} ${secondsLabel}`;
  }
  return { getSecondsInMinutesLabel };
}

export { useTimers };

